import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ProductListComponentComponent } from './ProductsModule/Infrastracture/Components/product-list-component/product-list-component.component';
import { ProductsRepository } from './ProductsModule/Infrastracture/Persistence/Repositories/products-repository.service';
import { IProductsRepository } from './ProductsModule/Core/Domain/Repositories/IProductsRepository';


@NgModule({
  declarations: [
    AppComponent,
    ProductListComponentComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [{provide: IProductsRepository, useClass: ProductsRepository}],
  bootstrap: [AppComponent]
})
export class AppModule { }
